import React from 'react'

const Home = () => {
    return (
        <>
        <div className="main grid grid-cols-12 gap-2 justify-center">
            <div className="details col-span-12 bg-black text-blue-500">Personal details</div>
            <div className="details col-span-4 bg-black text-blue-500">ORDER DETAILS</div>
            <div className="details col-span-4 bg-black text-blue-500">MESSAGE CENTER</div>
            <div className="details col-span-4 bg-black text-blue-500">FILE CENTER</div>
            <div className="details col-span-4 bg-black text-blue-500">BOOK TRY ON APPOINTMENT</div>
            <div className="details col-span-4 bg-black text-blue-500">VIRTUAL APPOINTMENT</div>

        </div>

        </>
    )
}

export default Home;
